import React from 'react'
import { Footer } from './componentsPage/footer'
import { Header } from './componentsPage/header'
import Reset from '../../styles/reset.css'

const Home = () => {
  return (
    <>
    <Reset>
      <Header/>
      <Footer/>
    </Reset>
    </>
  )
}

export { Home }
